import React from 'react';
const Layout= () =>{
    return(
        <div>
            <div class="container">
                <div class="flex-start item1 item-1">
                    Cậu có người yêu chưa?
                </div>
                <div class="item1 item-2">2</div>
                <div class="item1 item-3">3</div>
                <div class="item1 item-4">4</div>
            </div>
        </div>
    )
}
export default React.memo(Layout);
